(175, 751264739220258906, 'Message deleted', '2022-10-13 15:13:42', '<:gender:1022123849837453393> Дом дракона<:gender:1022123849837453393> \n\n<:emoji_142:1014066477940342854> Сегодня в 19:00 состоится просмотр  1 серии 1 сезона\n<:_dot_:1026110346894770277> Проводит трансляцилю: \n\n<:_dot_:1026110346894770277> Сюжет сериала: Таргариены всегда были самым могущественным домом, обладали невероятной силой и сплоченно жили на одной территории, но теперь пришло время покинуть насиженные места и отправиться на поиски нового дома. Герои решили отправиться на Запад, где обнаружили огромные земли, на которых они могли бы обустроиться и расширить свои владения.\n\n\nПроблема заключается в том, что на этих территориях существует несколько королевств, которые совсем не рады чужакам и готовы сделать все, чтобы они убрались восвояси. Кроме того, между самими Таргариенами происходит серьезный раскол, из-за чего они слабеют и становятся легкой добычей для захватчиков, которые могут напасть в любой момент.\n\n\nГерои должны объединиться и построить неприступный дом, или погибнуть под натиском весьма опасных соседей, желающих избавиться от опаснейших противников.', '---'),
