(7953, 947128012405620789, 'Message deleted', '2022-11-16 09:51:35', 'Нигер\nПетух (запрещено с конца 2021 года)\nМоскаль\nВатник\nПиратка\nПидр\nПедик\nГомик\nХиджаб\nХохлы\nХачи\nДаун, аутист (обратите внимание, эти, как могло бы показаться, детские обзывательства жёстко наказываются)\nПизда (если это слово используется по отношению к девушке, может расцениваться как унижение)\nОскорбления админов и меньшинств\nКонча\nЗапрещено запугивать, клеветать, оскорблять и раскрывать персональную информацию\nИнцел (человек который не может (или считает себя таковым) найти себе девушку)\nДевственник/девственница\nСимп (парни которые делают для девушек что либо хорошее и в ответ ничего в ответ) \nЧурка — оскорбительное название для уроженцев Азии или кавказского региона. Разрешено, если речь о поленьях («чурка дров»).\nЧерножопый/черномазый — запрещено, если используется для оскорбления людей с черным/коричневым оттенком кожи. Разрешено, если из контекста понятно, что речь не о расе/этничности, а о грязном человеке (синоним «чумазый»).\nГлиномес — запрещено, если используется для оскорбления гомосексуальных людей. Разрешено, если речь о человеке, работающем с глиной.\nПетух — запрещено, если используется для оскорбления гомосексуальных людей. Разрешено, если речь о животном.\nХач — оскорбительное название для этничностей кавказского региона. Запрещено использовать в любом контексте и в любой форме.\nЖид — оскорбительное название для евреев. Когда-то было легальным названием и даже сохранилось во многих славянских языках. Однако после антисемитских погромов черносотенцев в Российской Империи, его использование в русском языке признано оскорбительным.\nХохол/укроп — оскорбительное название для украинцев.\nКацап/москаль/русня — оскорбительное название для россиян.\nНигер/негр — оскорбительное название для черных людей. Долгое время на Твиче разрешалось использовать слово негр в русском языке, однако многие черные считают это оскорбительным, поэтому банить начали и за него.\nГомик/гомосек — то же, что и со словом пидор, но с исключением:\nПидор/пидорас/педераст/педрила/педик — тюремный жаргон, очень оскорбительное название для гомосексуальных людей. Использование этого слова для описания «плохих людей» только подчеркивает предвзятое отношение к геям в обществе, очерняя их сексуальную ориентацию. То же, что и называть всех «плохих людей» геями. Запрещено использовать даже гомосексуальным людям и в любой форме.\nnigger, nigga, naga, ниггер, нига, нага\nfaggot, пидор, пидорас, педик, гомик, петух (если не подразумевается птица)\nхохол, хач, жид, москаль\nхиджаб (в негативном контексте)\nдаун, аутист, дебил, retard.\nvirgin, simp, incel, девственник, cимп, инцел\ncunt, пизда (по отношению к девушке)\nкуколд, ватник, пиратка, конча.', '---'),
